import styled from 'styled-components';

export const WrapPost = styled.div`
    background: rgba(123, 154, 61, 0.7);
    height: 100vh;
`;

export const PostList = styled.ul`
    margin: 0;
    list-style: none;
    display: flex;
    flex-wrap: wrap;
`;
